/// Creates a new builder-style object to manufacture a `Response`
///
/// This method returns an instance of `Builder` which can be used to
/// create a `Response`.
///
/// # Examples
///
/// ```
/// # use http::*;
/// let response = Response::builder()
///     .status(200)
///     .header("X-Custom-Foo", "Bar")
///     .body(())
///     .unwrap();
/// ```
